/**
 * uri数据类型
 */
export declare type NetworkURI = string;
/**
 * 事件目标ID
 */
export declare type EventID = string;
/**
 * 页面ID
 */
export declare type PageID = string;
/**
 * 事件类型枚举
 */
export declare enum EventDataType {
    /**
     * 进入页面
     */
    pageIn = "pageIn",
    /**
     * 离开页面
     */
    pageOut = "pageOut",
    /**
     * 控件显示
     */
    viewShow = "viewShow",
    /**
     * 控件隐藏
     */
    viewHide = "viewHide",
    /**
     * 点击
     */
    click = "click",
    /**
     * 请求开始
     */
    reqStart = "reqStart",
    /**
     * 请求成功
     */
    reqSucc = "reqSucc",
    /**
     * 请求失败
     */
    reqFail = "reqFail",
    /**
     * 分享
     */
    share = "share"
}
/**
 * 比较符枚举
 * @remark 未作特殊说明的操作符，对任意类型都支持
 */
export declare enum Comparator {
    /**
     * 等于
     */
    Equal = "eq",
    /**
     * 不等于
     */
    NEQ = "neq",
    /**
     * 大于
     * @remark 仅支持数字
     */
    GT = "gt",
    /**
     * 小于
     * @remark 仅支持数字
     */
    LT = "lt",
    /**
     * 字符串匹配
     * @remark 仅支持字符串
     */
    Like = "lk",
    /**
     * 字段存在
     */
    Exist = "ex"
}
/**
 * 资源类型枚举
 */
export declare enum DataType {
    /**
     * 全局数据
     */
    Global = 1,
    /**
     * 事件数据
     */
    Event = 2,
    /**
     * 网络数据
     */
    Network = 3,
    /**
     * 页面上下文
     * @remark Native无此数据
     */
    Context = 4
}
/**
 * 设备类型枚举
 */
export declare enum DeviceType {
    android = "android",
    iphone = "iphone",
    ipad = "ipad",
    windows = "windows",
    mac = "mac",
    others = "others"
}
export declare enum ActType {
    click = "clk",
    view = "view",
    vision = "vision",
    default = ""
}
/**
 * 网络状态枚举
 */
export declare enum NetworkStatusType {
    Wifi = "wifi",
    N_5G = "5G",
    N4G = "4G",
    N3G = "3G",
    N2G = "2G",
    Others = "others"
}
/**
 * 键类型枚举
 */
export declare enum KeyType {
    /**
     * 字典键(dic) 按字典取值
     */
    Dict = "d",
    /**
     * 数组键(arr) 按数组取值
     */
    Arr = "a"
}
/**
 * 值类型枚举
 */
export declare enum ValueType {
    /**
     * 字符串
     */
    String = "s",
    /**
     * 数字
     */
    Number = "n"
}
/**
 * 内置事件名枚举
 */
export declare enum BuiltInName {
    AppLaunch = "$AppLaunch",
    AppShow = "$AppShow",
    AppHide = "$AppHide",
    PageShow = "$PageShow",
    PageHide = "$PageHide",
    PageShare = "$PageShare"
}
/**
 * 全局数据
 * @remark 通过sdk生成或设置的值
 */
export interface GlobalData {
    /**
     * 用户UID
     * @default "-1"
     * @example
     * `2420836027`
     */
    paid: string;
    /**
     * 用户昵称
     * @example
     * `188****0304`
     */
    un: string;
    /**
     * 设备CUID
     * @example
     */
    i: string;
    /**
     * 设备类型
     * @example
     * `"android"`
     */
    fr: DeviceType;
    /**
     * 设备型号
     * @example
     * `"OPPO A59s"`
     */
    mc: string;
    /**
     * 设备版本
     * @example
     * `"8.1.0"`
     */
    sv: string;
    /**
     * 设备分辨率
     * @example
     * `"720*1436"`
     */
    s: string;
    /**
     * 网络状态
     */
    l: NetworkStatusType;
    /**
     * 安装包下载渠道
     */
    channel: string;
    /**
     * 应用版本号
     */
    av: string;
    /**
     * 运营商编号
     * @example `"CMCC-XHhM"`
     */
    op: string;
    /**
     * 全埋点sdk版本
     */
    sdkVersion: string;
    /**
     * 网络ip地址
     */
    ip: string;
    /**
     * 城市
     */
    city?: string;
    /**
     * 省份
     */
    province?: string;
    /**
     * 国家
     */
    country?: string;
    /**
     * 事件发生所处平台
     */
    plat: string;
    /**
     * 事件发生页面ID
     */
    pageUUID: string;
    /**
     * 统计action
     */
    act: ActType;
}
/**
 * 全局公参
 * @remark
 * wiki全埋点参数定义 {@link http://wiki.afpai.com/pages/viewpage.action?pageId=87409248}
 */
export interface CommonParams extends GlobalData {
    /**
     * 埋点名称
     */
    name: string;
    /**
     * 时间戳
     * @example
     * `1575716732760`
     */
    t: number;
}
